function getEvents(n,t,i,r){"use strict";$.get({url:"http://localhost:8000/api/classes/range/"+(n.format("YYYY-MM-DD")+"/"+t.format("YYYY-MM-DD")),success:function(n){for(var f,i=[],t=0,u=n;t<u.length;t++)f=u[t],i.push(f);r(i.map(classToEvent))}})}function eventClicked(n){"use strict";$.get({url:"http://localhost:8000/api/classes/id/"+n.id,async:!0,success:function(n){var i="";for(var t in n)n.hasOwnProperty(t)&&(i+=t+": "+n[t]+"\n");alert(i)}})}function classToEvent(n){"use strict";return{id:n.id,title:n.subjectName+": "+n.type,start:moment.utc(n.dateTime),end:moment.utc(n.dateTime).add(1,"hours").add(20,"minutes").format()}}$(document).ready(function(){$("#calendar").fullCalendar({allDaySlot:!1,defaultView:"agendaWeek",eventClick:eventClicked,eventColor:"#0275D8",events:getEvents,weekends:!1,weekNumbers:!0});$("#calendar").fullCalendar("option","height","auto");$("#calendar").fullCalendar("option","minTime","08:00:00");$("#calendar").fullCalendar("option","maxTime","21:00:00")});